  static List<LanguageClassifierDistribution> listFromJson(dynamic json, {bool growable = false,}) {
    final result = <LanguageClassifierDistribution>[];
    if (json is List && json.isNotEmpty) {
      for (final row in json) {
        final value = LanguageClassifierDistribution.fromJson(row);
        if (value != null) {
          result.add(value);
        }
      }
    }
    return result.toList(growable: growable);
  }

  static Map<String, LanguageClassifierDistribution> mapFromJson(dynamic json) {
    final map = <String, LanguageClassifierDistribution>{};
    if (json is Map && json.isNotEmpty) {
      json = json.cast<String, dynamic>(); // ignore: parameter_assignments
      for (final entry in json.entries) {
        final value = LanguageClassifierDistribution.fromJson(entry.value);
        if (value != null) {
          map[entry.key] = value;
        }
      }
    }
    return map;
  }

  // maps a json object with a list of LanguageClassifierDistribution-objects as value to a dart map
  static Map<String, List<LanguageClassifierDistribution>> mapListFromJson(dynamic json, {bool growable = false,}) {
    final map = <String, List<LanguageClassifierDistribution>>{};
    if (json is Map && json.isNotEmpty) {
      // ignore: parameter_assignments
      json = json.cast<String, dynamic>();
      for (final entry in json.entries) {
        map[entry.key] = LanguageClassifierDistribution.listFromJson(entry.value, growable: growable,);
      }
    }
    return map;
  }

  static Map<String, dynamic> mapToJson(Map<String, LanguageClassifierDistribution> map) {
    final jsonMap = <String, dynamic>{};
    map.forEach((key, value) {
      jsonMap[key] = value.toJson();
    });
